var data = [];
var dataCount = 10;
var startTime = 0;
var categories = ['2017-10-23','2017-10-24','2017-10-25','2017-10-26','2017-10-27','2017-10-28','2017-10-29'];
var types = [
    {name: '30-40km/h', color: '#7b9ce1'},
    {name: '40-50km/h', color: '#bd6d6c'},
    {name: '50-60km/h', color: '#75d874'},
    {name: '60-70km/h', color: '#e0bc78'},
    {name: '70-80km/h', color: '#dc77dc'},
    {name: '80-90km/h', color: '#72b362'}
];

// Generate mock data
echarts.util.each(categories, function (category, index) {
    var baseTime = startTime;
    var randoms = createRandom(10,1440);
    for (var i = 0; i < dataCount; i++) {
        var typeItem = types[Math.round(Math.random() * (types.length - 1))];
        var duration = randoms[i];
        data.push({
            name: typeItem.name,
            value: [
                index,
                baseTime,
                baseTime += duration,
                duration
            ],
            itemStyle: {
                normal: {
                    color: typeItem.color
                }
            }
        });
    }
});

function createRandom(count,total){
    var randoms = [];
    var totalcurr = total;
	var totaltemp = 0.0;
	for (var i = 0; i < count - 1; i++) {
		var random = Math.random();
		randoms[i] = Math.round(random * totalcurr / 2) + 1;
		totalcurr = totalcurr - randoms[i];
		totaltemp += randoms[i];
	}
	randoms[count-1] = total - totaltemp;
	return randoms;
}

function renderItem(params, api) {
    var categoryIndex = api.value(0);
    var start = api.coord([api.value(1), categoryIndex]);
    var end = api.coord([api.value(2), categoryIndex]);
    var height = api.size([0, 1])[1] * 0.6;
    return {
        type: 'rect',
        shape: echarts.graphic.clipRectByRect({
            x: start[0],
            y: start[1] - height / 2,
            width: end[0] - start[0],
            height: height
        }, {
            x: params.coordSys.x,
            y: params.coordSys.y,
            width: params.coordSys.width,
            height: params.coordSys.height
        }),
        style: api.style()
    };
}


option = {
    tooltip: {
        formatter: function (params) {
            return params.marker + params.name + ': ' + params.value[3]/60 + ' h';
        }
    },
    grid: {
        height:120
    },
    xAxis: {
        type: 'value',
        max: 1440,
        interval: 60,
        axisLabel:{
            formatter: function (val,index) {
                console.info(val);
                var sss=val/60 + 'h';
            return sss;
            }
        }
    },
    yAxis: {
        data: categories
    },
    series: [{
        type: 'custom',
        renderItem: renderItem,
        itemStyle: {
            normal: {
                opacity: 0.8
            }
        },
        encode: {
            x: [1, 2],
            y: 0
        },
        data: data
    }]
};
